$(function(){$("#activitys").on("click",function(a){let activityId=$(a.target).data("activityid");if(activityId==undefined){return}$("#activityId").val(activityId);$("#activityDetail").submit()});$(".nowactbutton").on("click",function(a){let activityId=$(a.target).data("activityid");if(activityId==undefined){return}$("#activityId").val(activityId);$("#activityDetail").submit()});$("#pages").on("click",function(a){let page=$(a.target).text();$(a.target).attr("href","/activity?page="+page)})});